import React, { useState } from "react";
import Sresult from "./Sresult";

const Search = () => {
  const [img, setImg] = useState("");

  const typing = (event) => {
    const data = event.target.value;
    setImg(data);
  };

  return (
    <>
      <input
        placeholder="Search Image"
        type="search"
        value={img}
        onChange={typing}
      />
      <Sresult name={img} />,
    </>
  );
};

export default Search;
